const DiscosComprados = (Comprados , DiscosCargados) => {
    return ( 
        <div className="componente">
           {DiscosCargados && <div>
                <h1>Titulo</h1>
                {Comprados.forEach(Comprado => {
                    <div>
                        <h3>{Comprado.titulo}</h3>
                    </div>
                })}
            </div>}
        </div>
     );
}
 
export default DiscosComprados;
